import './SongItem.css'
import {useState} from "react";
import Card from "../card/Card";

function SongItem(props) {
    const expenseDate = new Date(2021, 2, 28);
    const [liked, setLiked] = useState(props.like)
    const clickHandler = () => {
        console.log(liked);
        console.log('1111');
        setLiked(true);
        console.log(liked);
    }

    return (
        <Card className="song">
            <table>
                <tr>
                    <td className='title'>{props.title}</td>
                    <td>{props.artist}</td>
                    <td>{props.album}</td>
                    <td>{props.duration}</td>
                    <td>{props.link}</td>
                    <td>{expenseDate.toUTCString()}</td>
                    <button className="liked" onClick={clickHandler}>like</button>
                </tr>
            </table>
        </Card>

    )
}

export default SongItem;
